            mainCategories[26] = "Shopping";
            mainCategories[27] = "Transportation";

            List<string> subCat;

            subCat = allC.Split(',').ToList<string>();

            

            for (int i = 0; i < subCat.Count; i++)
            {
                if (!tmp.ContainsKey(SuperClean(subCat[i])))
                {
                    tmp.Add(SuperClean(subCat[i]), new List<string>());
                }

                i++;

                tmp[SuperClean(subCat[i - 1])] = subCat[i].Split(';').ToList<string>();
            }


            
        }

        private string SuperClean(string inStr)
        {
            string t = ParseJSONObjects.cleanTextforSQL(inStr);
            string s = "";

            foreach (char x in t)
            {
                if (x != '?')
                {
                    s += x;
                }

            }

            return s;
        }

        public int cLength()
        {
            return mainCategories.Length;
        }

        public bool cExists(string bCategory)
        {
            return mainCategories.Contains(bCategory);

        }

        public Hashtable getAll
        {
            get
            {
                return tmp;
            }
        }

